import React from 'react'
import { Typography, Layout, Button } from 'antd';
import styled from 'styled-components'

const { Content } = Layout
const {Title, Paragraph} = Typography

const Container = styled(Content)`
    padding-top: 15%;
    padding-bottom: 15%;
`

const TitleStyled = styled(Title)`
    text-align: center;
    font-family: 'Mark Pro Bold';
`

const SubtitleStyled = styled(TitleStyled)`
    font-family: 'Mark Pro Medium';
`

const GetStartedButton = styled(Button)`
    font-family: 'Mark Pro Bold';
    color: #FFCB05;
    background-color: #00274c;
    font-size: 20px;
`

const FirstSection: React.FC = () => {
    return (
        <Container>
            <TitleStyled>The Sports Ticket Marketplace of the Future</TitleStyled>
            <SubtitleStyled level={4}>We make it both easier and safer to buy/sell Michigan Football tickets!</SubtitleStyled>
            <GetStartedButton>Get Started</GetStartedButton>
        </Container>
    )
}

export default FirstSection
